  [],\n\t\"revision_timestamp\": \"2016-08-10T10:41:12.292672\",\n\t\"name\": \"raw-and-processed-ground-penetrating-radar-and-post-processed-differential-global-position-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Scientists from the United States Geological
  Survey, St. Petersburg Coastal and Marine Science Center (USGS-SPCMS) acquired sediment
  cores, sediment surface grab samples, Ground Penetrating Radar (GPR) and Differential
  Global Positioning System (DGPS) data from Assateague Island, Maryland, in October
  (FAN 2014-322-FA) 2014. The objectives were to identify washover deposits in the
  stratigraphic record to aid in understanding barrier island evolution. The report
  associated with this metadata record serves as an archive of GPR and DGPS data collected
  from Assateague Island in October 2014. Data products and accompanying Federal Geographic
  Data Committee (FGDC) metadata can be downloaded from the Data Downloads page located
  at, http://pubs.usgs.gov/publication/ds989/ds_data_downloads.html.\",\n\t\"license_title\":
